import { AppBar, Box, Toolbar, Typography, List, ListItem, ListItemButton, ListItemText} from "@mui/material";
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import SearchIcon from '@mui/icons-material/Search';
import InputBase from '@mui/material/InputBase';
import { styled, alpha } from '@mui/material/styles';

const navItems = ['Home', 'Add Product', 'Login', 'Sign Up'];

const Search = styled('div')(({ theme }) => ({
    
}));

const SearchIconWrapper = styled('div')(({ theme }) => ({
   
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
    
}));


const Navbar = () => {
    return <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
            <Toolbar>
                <ShoppingCartIcon></ShoppingCartIcon>
                <Typography variant="h6" sx={{ flexGrow: 1, position:"inherit"}}>upGrad E-Shop</Typography>
                <Search>
                    <SearchIconWrapper>
                        <SearchIcon />
                    </SearchIconWrapper>
                    <StyledInputBase
                        placeholder="Searchâ€¦"
                        inputProps={{ 'aria-label': 'search' }}
                    />
                </Search>
                <List sx={{display: "inline"}}>
                    {navItems.map((item) => (
                    <ListItem key={item} disablePadding>
                        <ListItemButton sx={{ textAlign: 'center', display: "inline"}}>
                        <ListItemText primary={item} />
                        </ListItemButton>
                    </ListItem>
                    ))}
                </List>
            </Toolbar>
        </AppBar>
    </Box>
}

export default Navbar;
